1281		If south of the border is more your speed, order the chilaquiles ($8.50) at La Super-Rica Taquería. The hometown institution (and a favorite of iconic resident Julia Child) is where out-of-towners and longtime loyalists queue up for tacos. Don't miss the Monday special: crunchy tortillas chips doused with fragrant tomato sauce, cream and grilled green onions.\r\n\r\nNo trip to Santa Barbara is complete without tacos, seeing as the city is chock-full of taquerías. We're partial to the rajas tacos ($4), laden with gooey cheese and caramelized chile pasilla and onions, at La Super-Rica. Ask for extra fresh-off-the-presses tortillas for a one-plate meal, and pair with the agua fresca of the day.	3139	Clip	\N	public_comments	2016-06-03 07:30:23.286643	2016-06-03 07:30:23.286643
