1283		With dozens of farms around, Santa Barbara's weekly markets are bustling year-round. Every Tuesday and Saturday, chefs and locals shop the stalls of produce, nuts, oils and more at Downtown's Farmers' Market.	3142	Clip	\N	public_comments	2016-06-03 07:33:57.628898	2016-06-03 07:33:57.628898
1284		The newly opened Santa Barbara Public Market is the area's answer to SF's Ferry Building or Napa's Oxbow Public Market. Start at Culture Counter Co. Snack on a cheese cone ($5)—meatlovers can go for prosciutto or salumi (both $4)—a sampler of five slices. Continue on to Belcampo Meat Co. for cuts of lamb, pork, poultry and beef straight from its own ranch. If it's lunchtime, sit down to the Belcampo burger ($12.50) with caramelized onions and cheddar cheese. And make a stop at Wine + Beer. The shelves are stocked with bottles to take home, including selections from the nearby Santa Ynez Valley, and the tasting bar pours glasses and flights.	3143	Clip	\N	public_comments	2016-06-03 07:35:26.003674	2016-06-03 07:35:26.003674
