1346		Best dive bar in Denver. Cheap too\r\n\r\n"Since this space became known as the Knob Hill Inn in 1954, it's seen Colfax at it's worst. And while Denver's most notorious street is in the midst of a serious makeover these days, Nob Hill Inn's got a timeless quality that still gives you a quintessential Colfax experience that can't be replaced by trendy spots serving small plates and craft cocktails. Here, the drinks are cheap, the jukebox is cheaper, and the only thing on the menu is frozen pizza -- we hope that never changes."	3273	Clip	\N	public_comments	2016-06-15 01:55:12.830022	2016-06-15 01:55:12.830022
1347		"This Broadway go-to known for its all day, everyday drink specials -- including a list of $4 shots -- hasn't quite been around long enough to acquire the amount of old-school dust and grime found at other Denver dives. But with plenty of games to keep you busy while you drink, and some pretty solid bar food, Dive Inn has earned a special place in the city's buzzed heart. Oh yeah, there's also a boat in the middle of the bar."	3274	Clip	\N	public_comments	2016-06-15 01:55:33.223786	2016-06-15 01:55:33.223786
