1351		"This hidden gem is, in fact, hidden. Hanging out just off of the corner of Colfax and Marion, Tooey's wholeheartedly believes in the "less is more" mantra. The highlight of the place is the back bar, with shelves full of bottles that most dive bars can't pronounce, and knowledgeable barkeeps to go with it. There's a killer late-night happy hour, pool, and a jukebox that’ll keep you entertained until the lights (unfortunately) come up."	3280	Clip	\N	public_comments	2016-06-15 01:57:53.251084	2016-06-15 01:57:53.251084
1354		Used to be a mortuary. Has a rooftop bar\r\n\r\n"Yes, Linger used to have a better view, which is now partially blocked due to new buildings that went up in 2015. But no, we aren't irate about that. Mostly because we still get access to a rooftop where we can order Linger's global street food-inspired eats like lemongrass pork potstickers. Oh, and those cocktails that are served out of the retro RV-turned-bar that sits on top of this former mortuary cum dining favorite. And don't sleep on their brunch, which is served on the rooftop all summer long"	3271	Clip	\N	public_comments	2016-06-15 02:03:07.043399	2016-06-15 02:03:07.043399
1355		"Any place with "view" in its name better live up to the promise, and both ViewHouse won't disappoint. One is Downtown, close enough to Coors Field to be your go-to for pre- and post-game shenanigans, and the other is in Denver's southern suburbs where mountain views are the focus. Both feature huge rooftops with plenty of space for the crowds that frequently gather there. In fact, the rooftop area is so big, it's often used for yoga classes, movie showings, and other events."	3283	Clip	\N	public_comments	2016-06-15 02:03:42.343633	2016-06-15 02:03:42.343633
1356		Great Mexican food\r\n\r\n"Celebrating its 15th anniversary this year, Tamayo is still a popular spot for modern Mexican eats. The space is often rented out for private events, but when it's not, be sure to head upstairs. The entire area is heated and has a retractable roof, so even if the weather's not cooperating, you can still enjoy margaritas on the deck. Your best bet to snag a seat with a view? Head here for their $39 bottomless brunch (which includes both food and cocktails). "	3267	Clip	\N	public_comments	2016-06-15 02:04:18.727737	2016-06-15 02:04:18.727737
