1253	Zion National Park, Washington County, UT, United States	37.2982021999999986	-113.026300499999991	\N	1	cdff3c51f025a1cc1253b62a7cc4545c	2016-03-23 17:42:26.694561	2016-05-04 03:41:07.530186	\N	> Maps\nBryce Canyon map" https://drive.google.com/open?id=0B6sL0h_0pu81dXc3TW1VVzVCcjlhMnltVHhYdm83NEZNd0NJ\n\nUtah Parks map https://drive.google.com/open?id=0B6sL0h_0pu81VjBxdVdIaVBhT0hiYzV1aVlIcEpaY0Y4NF9v\n\nMisc on nearby attractions:\n\nhttp://utah.com/hiking/moab?cx_grid_position=7&cx_grid_size=2x1&cx_grid_image=full-image&cx_link_type=grid-link&cx_page_id=5579fa8be92e3ce056162728&cx_source_page_id=557bbaabe92e3cc612dd0379\n\nUltimate 10-day Utah Itinerary:\nhttps://drive.google.com/open?id=0B6sL0h_0pu81RGwtcGNpdGNiUVREX1RTV19zRldZdlVMcjA0\n\n> Bryce Canyon\nThe ranger programs at Bryce are highly recommended, and the Full Moon Walk does sound pretty neat. And there will even be a Lunar Eclipse Walk on Sept 27 (Full Moon Walks on the 26th and 28th). The walk is limited to 25 people (by lottery the day of at 4PM at the Lodge), so it is not guaranteed.\n\nRanger Programs:  Full Moon Hike (tickets by lottery at 4PM Bryce Lodge Aud) http://www.nps.gov/brca/planyourvisit/fullmoonhikes.htm\n\nSep 26,(27: on lunar eclipse),28; Oct 27\n\nSunset Point nice for sunset and Bryce Point sunrise (do not miss sunrise over amphitheater)\n\nWeather: Sep 74/37; Oct 63/29 http://utah.com/weather/bryce-canyon (Oct av. 58 deg, 2 in snow)\n\nCedar City Shakespeare Festival?  www.bard.org\n\n> Zion \nDon’t want to do The Narrows (slippery rocks, swimming, no sun)\n\nWeather: best Mar-May, Sep-Oct; summers too hot and winters too cold Sep: 91/60;  Oct 78/49\n\nShuttle System\n\nIn 1997, visitation was 2.4 million and increasing.&nbsp The shuttle system was established to eliminate traffic and parking problems, protect vegetation, and to restore tranquility to Zion Canyon.\n\nThe Zion Canyon Scenic Drive is open for shuttle busses only from early April through the end of\nOctober. Private vehicles are not allowed.&nbsp All other parts of the park are open to private vehicles. The shuttles operate in two loops, one making six stops in the town of Springdale and the other making eight stops at points of interest in the park.\n\nThe Springdale shuttle stops at six locations in Springdale.&nbsp Look for the "Shuttle Parking" signs throughout town. If you are staying at a lodge or motel, simply leave your car there and ride the town\nshuttle to the park. The parking lot at Zion Canyon Visitor Center commonly flls by mid-morning.\n\nThe Zion Canyon Shuttle loop stops at eight locations in the park.&nbsp The transfer between loops is made at the Zion Canyon Visitor Center. You may get on and of as often as you like. Riding the shuttle is free. The shuttle system operates April through October.\n\nFood Service\n\nZion Lodge Dining Room serves breakfast, lunch, and dinner.&nbsp Cafe ofers grab-and-go lunches. Dinner reservations are advised: 435-772-7760.\n\nOther food service restaurants are available in Springdale, at the East entrance, Mt. Carmel Junction, and Kanab.\n\nGrocery stores are available in Springdale and Kanab. Convenience stores are available in Mt. Carmel Junction.	\N	\N	\N	\N	fbab48d983b78adb2687
