299	Las Vegas, NV, United States	36.1699411999999967	-115.139829599999985	\N	1	6af17be9745ce3447e35ef1d70deeb8b	2016-02-29 22:46:49.45702	2016-05-04 03:41:03.232961	3	I have to say, that if you go there with the attitude that you're going to have a good time, then you really honestly can have a very very affordable good time. If you go there thinking vegas is going to be gross, seedy, and overbearing, then it will absolutely be the grossest, slimiest, most overbearing place on earth. I can still type\n\nThe outdoors:\n\nRed Rocks is one of the most beautiful places, and if you like camping, hiking, or rock climbing, it's scenery is hard to beat. It is just incredible and within spitting distance of the strip (not true, you need a car).\n\nThe Grand Canyon: it's definitely a day trip, but you can spend time in the grand canyon and yes every rim is beautiful, don't let anyone tell you one rim is worth seeing and another is not (I've seen most of the grand canyon at this point because of loving the outdoors and extensive travels... it's all good).\nWeird old towns around Vegas are also cool. Not really the outdoors and you'll have to do some digging, but it's worth it. Weird fake ghost towns, actual modern ghost towns, "old west" bs that's actually okay if you want to see the true weirdness that is the fake old west.\nThe insanity: Vegas really is one of the weirdest places on earth. You can walk indoors between a handful of the casinos on the strip, and use the weird monorail thing to get between others, so you can walk literally miles and miles in the 110 degree heat without stepping outdoors. The casinos all have their own "flavor" which is to say, you can see lots of weird fake art, real art, REALLY expensive art, restaurans, etc. framed in different ways by whatever management company is running that particular casino. The belagio fountains really are pretty awesome and a river in a casino is very strange.\nThe pools in vegas are just unreal fun. I love a good pool and they are just unmatched by other places. I know this isn't really a selling point for most people, but when you can get a wave pool and lazy river right next to a bunch of really nice chill pools it's a great way to spend a hot day. Plus... there's a waterslide through a shark tank. I mean. c'mon.\nOld vegas: it's as strange and seedy as Casino led you to believe, and there is enough weirdness to satisfy even the most weird human. GO SEE FAT ELVIS. He's the world's largest (and probably best) elvis impersonator and he kills (and it's free).\nCost: You can rent a car for nothing, or unlike most american cities, you can actually get by in vegas without renting a car at all. The strip is right next to the airport and there are busses or CHEAP cabs to get to old vegas. You can rent a car just for the day to get to red rocks, or for a couple days to explore the grand canyon. And hotels are VERY cheap for the quality you're getting.\n\ngood notes!\n	\N	\N	\N	\N	f536b22a0e4195e9a0cf
